        $moderado = [];
        $elevado = [];
        $muitoElevado = [];
        $maximo = [];

        $index = $this->tomorrow ? 'amanha' : 'hoje';
        $when = $this->tomorrow ? 'AMANH√É' : 'hoje';
        $when2 = $this->tomorrow ? 'para AMANH√É' : '';

        foreach ($all as $a) {
            if ($a[$index] === 'Elevado') {
                $elevado[] = $a['concelho'];
            } elseif ($a[$index] === 'Muito Elevado') {
                $muitoElevado[] = $a['concelho'];
            } elseif ($a[$index] === 'Maximo') {
